import React from 'react';
import './Skills.css'
const Skills = () => {
    return (
        <div>
            <div class="skills-container mx-6 px">
                    
                    <ul>
                       <li class="html">html5</li>
                       <li class="css">css3</li>
                       <li class="bootstrap">bootstrap</li>
                       <li class="bootstrap">tailwind</li>
                       <li class="javascript">javascript</li>
                       <li class="react">react.js</li>
                       <li class="jquery">Node.js</li>
                    </ul>
                   

                  </div>
        </div>
    );
};

export default Skills;
